css:
.fb-interactive-smartlog-comparison-view {
  display: flex;
  flex-direction: column;
  width: 100%;
  height: 100%;
}
.fb-interactive-smartlog-comparison-view .nuclide-ui-empty-state-message .loading {
  margin: auto;
}
.fb-interactive-smartlog-comparison-content {
  height: 100%;
  overflow-y: auto;
  border-top: 1px solid #c5cad3;
  background-color: #d1d4dc;
}
.fb-interactive-smartlog-comparison-file-view .fb-interactive-smartlog-hunk-view {
  border-bottom: 1px solid #c5cad3;
}
.fb-interactive-smartlog-hunk-view .gutter {
  background-color: #dcdfe4;
}
.fb-interactive-smartlog-file-fold {
  border-bottom: 1px solid #c5cad3;
  display: flex;
  justify-content: center;
  align-items: center;
  padding: 12px 0;
  background-color: #dcdfe4;
}
.fb-interactive-smartlog-file-fold .loading {
  margin-right: 10px;
}
.fb-interactive-smartlog-comparison-view .nuclide-ui-toolbar__left > :not(:first-child),
.fb-interactive-smartlog-comparison-view .nuclide-ui-toolbar__right > :not(:first-child) {
  margin-left: 10px;
}
.fb-interactive-smartlog-comparison-view-file-wrapper {
  margin: 10px;
  border-top: 1px solid #c5cad3;
  border-left: 1px solid #c5cad3;
  border-right: 1px solid #c5cad3;
  background-color: #e8eaed;
}
.fb-interactive-smartlog-comparison-file-header {
  position: sticky;
  top: 0;
  background-color: #e8eaed;
  z-index: 1;
  display: flex;
  padding: 5px;
  cursor: pointer;
  border-bottom: 1px solid #c5cad3;
}
.fb-interactive-smartlog-comparison-file-header:hover {
  background-color: #dcdfe4;
}
.fb-interactive-smartlog-comparison-file-header-M {
  color: #d5880b;
}
.fb-interactive-smartlog-comparison-file-header-A {
  color: #2db448;
}
.fb-interactive-smartlog-comparison-file-header-R {
  color: #f42a2a;
}
.fb-interactive-smartlog-comparison-file-status {
  flex-shrink: 0;
  width: 20px;
  text-align: center;
  border-style: solid;
  border-width: 1px;
  border-radius: 3px;
  margin-right: 5px;
}
.fb-interactive-smartlog-comparison-file-path {
  text-align: left;
  direction: rtl;
  overflow: hidden;
  white-space: nowrap;
  text-overflow: ellipsis;
  flex-grow: 1;
}
.hunk-grid-container {
  display: grid;
  font-family: monospace;
  border-bottom: 1px solid #c5cad3;
  white-space: pre-wrap;
  word-wrap: break-word;
  word-break: break-word;
  user-select: text;
  font-family: var(--editor-font-family);
  font-size: var(--editor-font-size);
  line-height: var(--editor-line-height);
}
.hunk-grid-container.split {
  grid-template-columns: repeat(2, auto 1fr);
}
.hunk-grid-container.unified {
  grid-template-columns: auto auto 1fr;
}
.hunk-line-number-grid-item {
  background-color: #dcdfe4;
  padding: 0 1em;
  user-select: none;
}
.hunk-line-number-grid-item.empty {
  padding: 0;
}
.hunk-line-number-clickable-grid-item:hover {
  text-decoration: underline;
  cursor: pointer;
}
.hunk-content-grid-item.added {
  border-left-style: solid;
  border-left-color: #2db448;
  border-left-width: 1px;
  background-color: rgba(45, 180, 72, 0.1);
}
.hunk-content-grid-item.removed {
  border-left-style: solid;
  border-left-color: #f42a2a;
  border-left-width: 1px;
  background-color: rgba(244, 42, 42, 0.1);
}
.hunk-content-grid-item.empty {
  user-select: none;
}
.fb-comparison-view-reviewer-context-header {
  display: flex;
  flex-direction: row;
  justify-content: space-between;
  padding: 10px;
}
.fb-comparison-view-reviewer-context-header-title-container {
  display: flex;
  justify-content: space-between;
  flex-direction: column;
}
.fb-comparison-view-reviewer-context-header-author {
  display: flex;
  flex-direction: row;
  padding-top: 10px;
}
.fb-comparison-view-reviewer-context-header-avatar {
  padding-left: 10px;
}
.fb-comparison-view-reviewer-context-header-title-text {
  font-weight: bold;
}
atom-panel.modal.fb-interactive-smartlog-comparison-view-modal {
  margin-left: 0;
  position: fixed;
  left: 20px;
  right: 20px;
  max-width: unset;
  width: unset;
}
atom-panel.modal.fb-interactive-smartlog-comparison-view-modal.from-top {
  top: 20px;
}
atom-panel.modal.fb-interactive-smartlog-comparison-view-modal .fb-interactive-smartlog-comparison-view {
  max-height: calc(100vh - 1.5em -  40px);
  border: 1px solid #c5cad3;
}
